import React from "react";
import { Link } from "react-router-dom";

function Signup() {
  return (
    <div>
      <div>
        <Link to="./StudentSignup" className="btn btn-primary btn-lg btn-block">
          <h2>Student Sign up</h2>
        </Link>
      </div>
      <span className="btn btn-primary btn-lg btn-block">
        <h2>{""}</h2>
      </span>
      <div>
        <Link to="./CompanySignup" className="btn btn-primary btn-lg btn-block">
          <h2>Company Sign up</h2>
        </Link>
      </div>
    </div>
  );
}

